import React from 'react';
import styled from 'styled-components';

const Diveiei=styled.div`
margin:50px;
padding:20px;`
;
const Form=styled.form
`
margin: auto;
background-color: gray;
height:400px;
width:300px;
border-radius:50px;
`;
const Labe=styled.label
`
 text-decoration:square;
`;
const Inp=styled.input
`
border-radius:10px;
width=:300px;
line-break:auto; 
`;
const Butt=styled.button
`
border-radius:10px
`;
const H1=styled.h1
`
text-align=center;
color:white;
`;
class LOGIN extends React.Component{
  render() 
  {
    return (
    <Diveiei>
        
      <Form>
        <H1>LOGIN</H1>
        <Inp type="Username" placeholder="Username"></Inp>
        <Inp type="Password" placeholder="Password"></Inp>
        <Butt type="submit">Login</Butt>
        </Form>
    </Diveiei>
      )
    
  }
}

export default LOGIN;
